var assert = require("assert");
import { add } from "../add.js"
//describe是分组的机制
describe('add function testing', () => {
    it('1+2 should be 3', () => {
        assert.equal(add(1, 2), 3)
    });
    it('-4+2 should be -3', () => {
        assert.equal(add(-4, 2), -2)
    });
});

